import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

// Simple components for each page
function Hero() {
  return (
    <div className="text-center mt-5">
      <h2>Welcome to GreenGoods!</h2>
      <p>Your favorite plant store</p>
    </div>
  );
}

function Login() {
  return (
    <div className="text-center mt-5">
      <h2>Login Page</h2>
      <p>Please enter your credentials to login.</p>
    </div>
  );
}

function Profile() {
  return (
    <div className="text-center mt-5">
      <h2>Profile Page</h2>
      <p>View and edit your profile here.</p>
    </div>
  );
}

function Orders() {
  return (
    <div className="text-center mt-5">
      <h2>Orders Page</h2>
      <p>Track your orders here.</p>
    </div>
  );
}

function Cart() {
  return (
    <div className="text-center mt-5">
      <h2>Cart Page</h2>
      <p>Check items in your shopping cart.</p>
    </div>
  );
}

function Search() {
  return (
    <div className="text-center mt-5">
      <h2>Search Page</h2>
      <p>Search for plants and products.</p>
    </div>
  );
}

// Navigation bar component
function NavBar() {
  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-success">
      <div className="container">
        <Link className="navbar-brand text-white" to="/">GreenGoods</Link>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav"
          aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ms-auto">
            <li className="nav-item">
              <Link className="nav-link text-white" to="/">Hero</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" to="/login">Login</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" to="/profile">Profile</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" to="/orders">Orders</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" to="/cart">Cart</Link>
            </li>
            <li className="nav-item">
              <Link className="nav-link text-white" to="/search">Search</Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

// Main App component with routing
function App() {
  return (
    <Router>
      <NavBar />
      <div className="container">
        <Routes>
          <Route path="/" element={<Hero />} />
          <Route path="/login" element={<Login />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/orders" element={<Orders />} />
          <Route path="/cart" element={<Cart />} />
          <Route path="/search" element={<Search />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
